import React from 'react';
import { GoogleLogin, useGoogleLogin } from '@react-oauth/google';
import { Link } from 'react-router-dom';

const Login = ({ onSuccess, onFailure }) => {
  const googleLogin = useGoogleLogin({
    onSuccess: (tokenResponse) => {
      console.log('Google login successful', tokenResponse);
      // You can now use the tokenResponse to authenticate the user in your app
    },
    onError: () => {
      console.error('Google login failed');
      // Handle login errors here
    },
    flow: 'auth-code', // Use 'auth-code' for the authorization code flow
  });

  return (
    <div className="list-group">
      <Link to="/contacts" className="list-group-item list-group-item-action ">
        Friends
      </Link>
      <Link to="#" className="list-group-item list-group-item-action">
        Groups
      </Link>
      <button className="list-group-item list-group-item-action" onClick={() => googleLogin()}>
      Sign in with Google ðŸš€
    </button>
      <GoogleLogin
        render={renderProps}
        buttonText="Sign with Google to Import Contacts"
        onSuccess={onSuccess}
        onFailure={onFailure}
        scope="https://www.googleapis.com/auth/contacts.readonly"
      />
    </div>
  );
};

export default Login;
